  [],\n\t\"num_tags\": 0,\n\t\"name\": \"near-shore-wave-and-current-data-fronting-the-waikiki-natatorium-august-2007-nodc-accession-004\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Field data collection was conducted for
  the U.S. Army Engineer District, Pacific Ocean, Honolulu (POH), during 23-29 August
  2007, in the vicinity of the Natatorium, a World War I memorial in Kapiolani Park,
  Honolulu, Oahu, Hawaii. Three bottom mounted instruments were deployed to measure
  waves and currents. A Nortek AWAC (1 MHz) acoustic current profiler was placed seaward
  of the reef, centered off the Natatorium, in about 5m depth. An RD Instruments ADCP
  (1.2 MHz) current profiler was mounted on the channel bottom near the entrance,
  in about 3m depth. The third unit was a Nortek Aquadopp current profiler (2 MHz)
  was placed in a small hole in the reef, about 35m seaward of the Natatorium pool
  outer wall in a nominal depth of 1.5m. The first two gauges recorded directional
  waves and current profiles, the Aquadopp only recorded current profiles. Four inexpensive
  current drogues (drifters) were designed and built at the CHL Field Research Facility
  (FRF) that used GPS tracking and radio telemetry for positioning.\",\n\t\"owner_org\":
